  const [note, setNote] = useState({
    title: "",
    content: "",
  });

  return (
    <div className="main_note">
      <from>
        <input type="text" value=""  placeholder="Title" autoComplete="off" />
        <textarea rows="" column="" value=""  placeholder="Write a note..."></textarea>

        <Button>
          <AddIcon className="plus_sign" />
        </Button>
      </from>
    </div>
  );
};

export default CreateNote;
